import { cst } from "./cst";

export class LoadScene extends Phaser.Scene {
  maze: any;
  constructor() {
    super({
      key: cst.scenes.load
    })
  }
  loadImages() {
    this.load.setPath("./assets/image/bg");
    for (let prop in cst.image.bg) {
      //@ts-ignore
      this.load.image(cst.image.bg[prop],cst.image.bg[prop]);
    }
    this.load.setPath("./assets/image/ui");
    for (let prop in cst.image.ui) {
      //@ts-ignore
      this.load.image(cst.image.ui[prop],cst.image.ui[prop]);
    }
    this.load.setPath("./assets/image/sprite");
    for (let prop in cst.image.sprite) {
      //@ts-ignore
      this.load.image(cst.image.sprite[prop],cst.image.sprite[prop]);
    }
    
  }
  preload() {
    this.loadImages();
    this.load.on("load", (file: Phaser.Loader.File)=>{
      console.log(file.src);
    }
  }
  create() {
    const generator = require("generate-maze");
    this.cameras.main.setBackgroundColor(0xffffff)
    this.maze = generator(4,5,);
    console.log(this.maze);
    let mazeRooms = [];
    for (let i = 0; i < this.maze.length; i++) {
      mazeRooms[i] = [];
      for (let j = 0; j < this.maze[i].length; j++) {
        let room = this.maze[i][j];
        if (!room.top) {
          if (!room.left) {
            if (!room.right == true) {
              if (!room.bottom) {
                mazeRooms[i][j] = this.add.image(j*100+100,i*100+100,cst.image.ui.cross);
              } else {
                mazeRooms[i][j] = this.add.image(j*100+100,i*100+100,cst.image.ui.teeT);
              }
            } else if (!room.bottom) {
              mazeRooms[i][j] = this.add.image(j*100+100,i*100+100,cst.image.ui.teeL);
            } else {
              mazeRooms[i][j] = this.add.image(j*100+100,i*100+100,cst.image.ui.turnTL);
            }
          } else if (!room.right) {
            if (!room.bottom) {
              mazeRooms[i][j] = this.add.image(j*100+100,i*100+100,cst.image.ui.teeR);
            } else {
              mazeRooms[i][j] = this.add.image(j*100+100,i*100+100,cst.image.ui.turnTR);
            }
          } else if (!room.bottom) {
            mazeRooms[i][j] = this.add.image(j*100+100,i*100+100,cst.image.ui.straightV);
          } else {
            mazeRooms[i][j] = this.add.image(j*100+100,i*100+100,cst.image.ui.endT);
          }
        } else if (!room.left) {
          if (!room.right) {
            if (!room.bottom) {
              mazeRooms[i][j] = this.add.image(j*100+100,i*100+100,cst.image.ui.teeB);
            } else {
              mazeRooms[i][j] = this.add.image(j*100+100,i*100+100,cst.image.ui.straightH);
            }
          } else if (!room.bottom) {
            mazeRooms[i][j] = this.add.image(j*100+100,i*100+100,cst.image.ui.turnBL);
          } else {
            mazeRooms[i][j] = this.add.image(j*100+100,i*100+100,cst.image.ui.endL);
          }
        } else if (!room.right) {
          if (!room.bottom) {
            mazeRooms[i][j] = this.add.image(j*100+100,i*100+100,cst.image.ui.turnBR);
          } else {
            mazeRooms[i][j] = this.add.image(j*100+100,i*100+100,cst.image.ui.endR);
          }
        } else if (!room.bottom) {
          mazeRooms[i][j] = this.add.image(j*100+100,i*100+100,cst.image.ui.endB);
        }
      }
    }
  }
  update(delta:number) {
  
  }
}
